import { useState } from 'react';

function App() {
  const [log, setLog] = useState([]);

  const handleClick = (action) => {
    const time = new Date().toLocaleTimeString();
    setLog(prev => [...prev, `${time} - ${action}`]);
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Quantum Metric Tracker Demo</h1>
      <button onClick={() => handleClick('Clicked Button A')}>Button A</button>
      <button onClick={() => handleClick('Clicked Button B')}>Button B</button>
      <input
        type="text"
        placeholder="Type something"
        onChange={(e) => handleClick(`Typed: ${e.target.value}`)}
      />
      <h3>Event Log:</h3>
      <ul>
        {log.map((entry, idx) => <li key={idx}>{entry}</li>)}
      </ul>
    </div>
  );
}

export default App;
